#Assignment 2 - Testing the Optimization (completed)from assignment2_quadprog import PQPimport numpy as np#Testing - DO NOT CHANGE M_con, Hinv_,g_con!M_con = np.array([[ 1,  0],       [-1,  0],       [ 0,  1],       [ 0, -1]])Hinv = np.array([[ 0.04999785, -1.9332337233542412e-05  ],              [-1.9332337233542412e-05  ,  4.072081060148925e-06  ]])#constraints: 0 < thrust < 1, elevator < |0.4363|g_con = np.array([1.   , 0.   , 0.4363, 0.4363])f = np.array([34.616, 356612.612])#Initialize the optimizerqp = PQP(M_con, Hinv, g_con, f)#Perform optimizationqp.Optimize()#Get the constrained inputU = -Hinv @ (f + 0.5*M_con.T @ qp.lam)#Plot resultsqp.plotResult(U)